import React, {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Checker from "./components/Checker";
import Home from "./components/Home";

function App() {
  return (
    <>
      <Router>
        <div>
          <nav>
            <ul>
              <li>
                <Link to="/">Home</Link>
              </li>
              <li>
                <Link to="/wheather">Checker Wheather</Link>
              </li>
            </ul>
          </nav>

        <Switch>
          <Route path="/" component={Home}></Route>
          <Route path="/wheather">
              <Checker/>        </Route>
        </Switch>
        </div>

      </Router>

    </>
  );
}

export default App;
